import React from "react";


const appRouter = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
    children: [
      {
        path: "/",
        element: <Home/>,
      },
      {
        path: "/submisssions",
        element: <Submissions/>
      },
    ],
  },
]);

const App = () => {
  return (
    <div>
      <RouterProvider route={appRouter} />
    </div>
  );
};

export default App;
